import React, { Component} from 'react';
import {
    HeaderWrapper,Logo
} from './style.js';

class Header extends Component {
    render(){
        return (
            <HeaderWrapper><Logo href='/'/></HeaderWrapper>
            );
    }
}

export default Header;
